ormat":"","label":"powlaw_stat"},"ra":{"axis":"ra","format":"","label":"ra"},"ra_cat":{"axis":"ra","format":"toFixed(8)","label":"ra"},"ra_pnt":{"axis":"ra_pnt","format":"","label":"ra_pnt"},"ref":{"axis":"ref","format":"","label":"ref"},"refs":{"axis":"refs","format":"","label":"refs"},"remove_code":{"axis":"remove_code","format":"","label":"remove_code"},"rgeo":{"axis":"rgeo (pc)","format":"toFixed(3)","label":"rgeo"},"rpgeo":{"axis":"rpgeo","format":"","label":"rpgeo"},"sat_src_flag":{"axis":"sat_src_flag","format":"","label":"sat_src_flag"},"significance":{"axis":"significance","format":"","label":"significance"},"significance_max":{"axis":"Signif. (\u03c3)","format":"toFixed(3)","label":"Signif."},"streak_src_flag":{"axis":"streak_src_flag","format":"","label":"streak_src_flag"},"usrid":{"axis":"usrid","format":"","label":"usrid"},"var_inter_prob":{"axis":"1 / (1.001 - P_inter)","format":"toFixed(3)","label":"P_inter"},"var_inter_prob_b":{"axis":"var_inter_prob_b","format":"","label":"var_inter_prob_b"}},"cite_text":"","class_column":"Class","classes_dict":{"AGN":"AGN","ATNF":"NS","CV":"CV","HM-STAR":"HM-STAR","HMXB":"HMXB","LM-STAR":"LM-STAR","LMXB":"LMXB","NS":"NS","YSO":"YSO"},"classes_dict_json":"{\n    \"AGN\": \"AGN\",\n    \"CV\": \"CV\",\n    \"HM-STAR\": \"HM-STAR\",\n    \"HMXB\": \"HMXB\",\n    \"LM-STAR\": \"LM-STAR\",\n    \"LMXB\": \"LMXB\",\n    \"ATNF\": \"NS\",\n    \"YSO\": \"YSO\"\n}","columns_to_remove":["columns_to_remove","use_raw_cols_list","all","single_class_column_name","last_changed_column","derived_labels","classes_dict_json","hover_table_names_json"],"contact_text":"&lt;a href = \"mailto: huiyang@gwu.edu\" target=\"_blank\"&gt;Contact&lt;/a&gt;","derived":{"BP-G":{"axis":"BP-G","format":"toFixed(3)","label":"BP-G","use":true},"BP-RP":{"axis":"BP-RP","format":"toFixed(3)","label":"BP-RP","use":true},"F_x/F_o":{"axis":"F_x/F_o","format":"toExponential(3)","label":"F_x/F_o","use":true},"G-K":{"axis":"G-K","format":"toFixed(3)","label":"G-K","use":true},"H-K":{"axis":"H-K","format":"toFixed(3)","label":"H-K","use":true},"HR_h(ms)":{"axis":"HR_h(ms)","format":"toFixed(3)","label":"HR_h(ms)","use":true},"HR_hm":{"axis":"HR_hm","format":"toFixed(3)","label":"HR_hm","use":true},"HR_ms":{"axis":"HR_ms","format":"toFixed(3)","label":"HR_ms","use":true},"J-H":{"axis":"J-H","format":"toFixed(3)","label":"J-H","use":true},"M_G":{"axis":"M_G","format":"toFixed(3)","label":"M_G","use":true},"W1-W2":{"axis":"W1-W2","format":"toFixed(3)","label":"W1-W2","use":true}},"derived_func_js":"\n\n    var color_features = ['BP-G', 'BP-RP', 'G-K', 'J-H', 'H-K', 'W1-W2']\n\n    for (var f of color_features) {\n    \n        var s = f.split('-')\n        \n        //console.log('s: ', s)\n        \n        //console.log('df_custom: ', df_custom)\n        \n        //console.log('df_custom[s[0]]: ', df_custom[s[0]])\n        \n        df_custom[f] = df_custom[s[0]].map(function (v, i) { return v - df_custom[s[1]][i]; })\n    \n    }\n        \n    function hr(a, b) {\n    \n        let c = a + b\n        \n        if (c==0) return NaN    \n    \n        return (a - b) / c;\n    };\n    \n    df_custom['HR_ms'] = df_custom['F_m'].map(function (v, i) { return hr(v, df_custom['F_s'][i]); })\n    df_custom['HR_hm'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i]); })\n    df_custom['HR_h(ms)'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i] + df_custom['F_s'][i]); })\n    \n    df_custom['F_x/F_o'] = df_custom['F_b'].map(function (v, i) { \n        return Math.pow(10, Math.log10(v) + 5 - Math.log10(1.65) + df_custom['G'][i] / 2.5); })\n            \n    //df_custom[class_column] = df_custom[class_column].map(x =&gt; x.replace('ATNF', 'NS'))\n    \n    //df_custom['P_inter'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    //df_custom['P_intra'] = df_custom['P_intra'].map(x =&gt; 1.001 - x)\n    \n    if ('rgeo' in df_custom) \n    \n        df_custom['M_G'] = df_custom['rgeo'].map(function (v, i) { \n            return df_custom['G'][i] - 5 * Math.log10(v/10); })\n        \n    //df_custom['P_intra'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    \n","derived_func_py":"\n\nimport numpy as np\n\ndef hr(a, b): \n    s = a + b        \n    s[s==0] = np.nan        \n    return (a - b) / s\n\ndef derived_func(df, q):\n\n    derived_labels = [q['derived'][k]['label'] for k in q['derived'].keys()]\n\n    if 'M_G' in derived_labels:\n        df['M_G'] = df['G'] - 2.5 * np.log10((df['rgeo']/10)**2)\n\n    fh, fm, fs = df[['F_h', 'F_m', 'F_s']].to_numpy().T\n    df['HR_ms'] = hr(fm, fs) \n    df['HR_hm'] = hr(fh, fm) \n    df['HR_h(ms)'] = hr(fh, fm + fs)\n\n    color_features = ['BP-G', 'BP-RP', 'G-K', 'J-H', 'H-K', 'W1-W2']\n    for k in color_features:    \n        p1, p2 = k.split('-')    \n        df[k] = df[p1] - df[p2]\n\n    df['F_x/F_o'] = np.float_power(10, np.log10(df['F_b']) + 5 - np.log10(1.65) + df['G'] / 2.5) \n\n    # df['P_inter'] = 1.001 - df['P_inter']\n    # df['P_intra'] = 1.001 - df['P_intra']\n\n    return df\n    \n","derived_labels":["HR_ms","HR_hm","HR_h(ms)","F_x/F_o","BP-G","BP-RP","G-K","J-H","H-K","W1-W2","M_G"],"description_text":"&lt;a href=\"./RNAAS_note_about_TD.pdf\" target=\"_blank\"&gt;description&lt;/a&gt;","features":["F_b","F_h","F_m","F_s","P_inter","P_intra","Signif.","G","BP","RP","J","H","K","W1","W2","W3","rgeo","HR_ms","HR_hm","HR_h(ms)","F_x/F_o","BP-G","BP-RP","G-K","J-H","H-K","W1-W2","M_G"],"features_no_loglin":["G","BP","RP","J","H","K","W1","W2","W3","BP-G","BP-RP","G-K","J-H","H-K","W1-W2"],"flipped_axis":["M_G"],"format_js":" \n\n    function format(d) {\n            \n        var i = Number(d.DT_RowId.slice(2))\n        \n        var name = table_source.data['name'][i]\n        \n        var div_id = `\"aladin-lite-div` + name.replace(/[^A-Z0-9]+/ig, \"_\") + `\"`\n                \n        var out = '&lt;div id=' + div_id + ' style=\"width:400px;height:400px;\"&gt;&lt;/div&gt;'+\n            '&lt;script type=\"text/javascript\"&gt;' +\n            'var aladin = A.aladin(\"#' + div_id.slice(1) + ', {survey: \"P/2MASS/color\", fov:0.05, cooFrame:\"ICRSd\", target: \"' + \n            table_source.data['ra'][i] + ', ' + table_source.data['dec'][i] + '\"});&lt;/script&gt;' \n        \n        var esa_sky = 'https://sky.esa.int/?target=' + table_source.data['ra'][i] + '%20' + table_source.data['dec'][i] + \n            '&amp;hips=DSS2+color&amp;fov=0.05&amp;cooframe=J2000d&amp;sci=false&amp;lang=en&amp;hide_welcome=true&amp;hide_banner_info=true'\n            \n        var out2 = '&lt;iframe alt=\"\" border=\"0\" bordercolor=\"#000000\" frameborder=\"0\" height=\"\" hspace=\"0\" ' +\n            'scrolling=\"auto\" ' +\n            'src=\"' + esa_sky + '\" title=\"\" vspace=\"0\" width=\"400px\" ' +\n            'class=\"\" style=\"height: 400px;\"&gt;' +\n            'https://sky.esa.int?hide_welcome=true&amp;amp;&amp;amp;hide_banner_info=true.' +\n            '&lt;/iframe&gt;'   \n                \n        return out + out2\n    }\n","get_ref_link_js":"\n\n    function get_ref_link(ref) {\n    \n        var ref_link\n\n        if (ref=='INTEGRAL General Reference Catalog') {\n            ref_link = 'https://www.isdc.unige.ch/integral/science/catalogue'\n            ref = 'INTEGRAL'\n        }    \n        else if (ref=='Simbad')\n            ref_link = 'http://simbad.u-strasbg.fr/simbad/'\n        else if (ref=='LAMOST-DR8-AFGK' || ref=='LAMOST-DR8-M')\n            ref_link = 'http://www.lamost.org/dr8/'\n        else\n            ref_link = 'https://ui.adsabs.harvard.edu/abs/' + ref + '/abstract' \n\n        ref_link = '&lt;a href=\"' + ref_link + '\" target=\"_blank\"&gt;' + ref + '&lt;/a&gt;'    \n\n        return [ref, ref_link]\n    \n    }\n","help_text":"\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\nFor plotting custom objects, the user should provide a csv file.\nThe following column labels are accepted (columns with other names are ignored):\n\n    name \n    ra \n    dec \n    Class \n    ref \n\n    F_b \n    F_h \n    F_m \n    F_s \n\n    P_inter \n    P_intra \n\n    significance | Signif.\n\n    G \n    BP \n    RP \n    J \n    H \n    K \n    W1 \n    W2 \n    W3 \n \nAll columns are optional. \n\nWarning: All multiwavelength features from optical to IR bands are removed for NS in the visualization since the counterparts are matched from chance coincidence. We still keep those counterparts in the machine learning pipeline to avoid adding a bias.\n\nThe following features are calculated from the user-supplied data:\n\n    HR_ms\n    HR_hm \n    HR_h(ms)\n    F_x/F_o\n    BP-G\n    BP-RP\n    G-K\n    J-H\n    H-K\n    W1-W2\n\nHR_ms = (F_m - F_s) / (F_m + F_s)\nHR_hm = (F_h - F_m) / (F_h + F_m)\nHR_h(ms) = (F_h - F_m - F_s) / (F_h + F_m + F_s)\nF_x/F_o = F_b / (1.65e-5 * 10**(-G / 2.5))\n\nClass labels:\n\n    AGN \n    CV \n    HM-STAR \n    HMXB \n    LM-STAR \n    LMXB \n    NS  \n    YSO\n\nUnclassified objects or objects with different class labels are shown as white circles.\n\nWarning: AGN shown here come from above the Galactic plane and will look different through the plane due to much higher absorption.\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\n","hide_csv_etc_button":false,"hide_settings_panel":true,"hide_upload_button":false,"hover_table_names":{"F_b":"F_b","G":"G","HR_h(ms)":"HR_h(ms)","J":"J","W1":"W1","dec":"Decl.","name":"name","ra":"RA","ref":"ref"},"hover_table_names_json":"{\n    \"name\": \"name\",\n    \"ra\": \"RA\",\n    \"dec\": \"Decl.\",\n    \"F_b\": \"F_b\",\n    \"HR_h(ms)\": \"HR_h(ms)\",\n    \"G\": \"G\",\n    \"J\": \"J\",\n    \"W1\": \"W1\",\n    \"ref\": \"ref\"\n}","html_title":"CXO Training Dataset","include_version":true,"ini_visible_classes":["AGN","LM-STAR"],"ini_xy_text":["F_b","BP"],"last_changed_column":-1,"log_features":["F_b","F_h","F_m","F_s","P_inter","P_intra","Signif.","F_x/F_o"],"non_features":["name","ra","dec","Class"," */\n          overflow: auto; /* Enable scroll if needed */\n          background-color: rgb(0,0,0); /* Fallback color */\n          background-color: rgba(0,0,0,0.4); /* Black w/ opacity */\n        }\n\n        /* Modal Content */\n        .modal-content {\n          background-color: #fefefe;\n          margin: auto;\n          padding: 20px;\n          border: 1px solid #888;\n          width: 80%;\n          white-space: pre-wrap;\n        }    \n    &lt;/style&gt;\n    \n\n        &lt;div id=\"my_help\" class=\"modal\", style=\"display: none;\"&gt;\n\n            &lt;button onclick=\"document.getElementById('my_help').style.display='none'\"&gt;Close&lt;/button&gt; \n\n            &lt;div class=\"modal-content\"&gt;\n\n                \n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\nFor plotting custom objects, the user should provide a csv file.\nThe following column labels are accepted (columns with other names are ignored):\n\n    name \n    ra \n    dec \n    Class \n    ref \n\n    F_b \n    F_h \n    F_m \n    F_s \n\n    P_inter \n    P_intra \n\n    significance | Signif.\n\n    G \n    BP \n    RP \n    J \n    H \n    K \n    W1 \n    W2 \n    W3 \n \nAll columns are optional. \n\nWarning: All multiwavelength features from optical to IR bands are removed for NS in the visualization since the counterparts are matched from chance coincidence. We still keep those counterparts in the machine learning pipeline to avoid adding a bias.\n\nThe following features are calculated from the user-supplied data:\n\n    HR_ms\n    HR_hm \n    HR_h(ms)\n    F_x/F_o\n    BP-G\n    BP-RP\n    G-K\n    J-H\n    H-K\n    W1-W2\n\nHR_ms = (F_m - F_s) / (F_m + F_s)\nHR_hm = (F_h - F_m) / (F_h + F_m)\nHR_h(ms) = (F_h - F_m - F_s) / (F_h + F_m + F_s)\nF_x/F_o = F_b / (1.65e-5 * 10**(-G / 2.5))\n\nClass labels:\n\n    AGN \n    CV \n    HM-STAR \n    HMXB \n    LM-STAR \n    LMXB \n    NS  \n    YSO\n\nUnclassified objects or objects with different class labels are shown as white circles.\n\nWarning: AGN shown here come from above the Galactic plane and will look different through the plane due to much higher absorption.\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\n\n\n            &lt;/div&gt;        \n\n        &lt;/div&gt;  \n\n    "},"id":"4134","type":"Div"},{"attributes":{"data":{"BP":["NaN",20.427433,"NaN","NaN",20.897734,18.219099,16.550129,19.800734,18.456608,20.590179,19.274035,16.3564,22.007179,"NaN",17.337835,18.663326,"NaN","NaN","NaN","NaN","NaN","NaN","NaN","NaN","NaN",13.793571,"NaN","NaN",19.466633,20.33053,18.628828,"NaN","NaN","NaN","NaN","NaN",19.565577,"NaN","NaN","NaN",18.61022,"NaN","NaN",21.675379,20.943958,"NaN","NaN",19.636585,"NaN","NaN","NaN",20.335602,18.166552,"NaN","NaN","NaN","NaN","NaN","NaN",19.550291,"NaN","NaN",18.82446],"BP-G":["NaN",0.9444470000000003,"NaN","NaN",0.09502600000000072,0.7465340000000005,0.3180729999999983,0.4841679999999968,0.38595199999999963,0.14812599999999776,-1.290298,0.5850760000000008,1.2092279999999995,"NaN",1.111115999999999,-0.33763099999999824,"NaN","NaN","NaN","NaN","NaN","NaN","NaN","NaN","NaN",0.18329899999999988,"NaN","NaN",0.532154000000002,0.15445700000000073,1.413176,"NaN","NaN","NaN","NaN","NaN",0.06126400000000132,"NaN","NaN","NaN",0.7557980000000022,"NaN","NaN",1.1356889999999993,0.4961529999999996,"NaN","NaN",0.21386899999999898,"NaN","NaN","NaN",0.335249000000001,-0.028566000000001424,"NaN","NaN","NaN","NaN","NaN","NaN",0.3457640000000026,"NaN","NaN",0.026531999999999556],"BP-RP":["NaN",1.8728940000000023,"NaN","NaN",0.9203489999999981,1.6781189999999988,0.7476859999999981,1.152358999999997,0.9793039999999991,0.7423779999999987,1.3749280000000006,1.3201780000000003,2.192821000000002,"NaN",2.1589259999999975,0.8116810000000001,"NaN","NaN","NaN","NaN","NaN","NaN","NaN","NaN","NaN",0.4994650000000007,"NaN","NaN",1.6611180000000019,0.8010270000000013,2.836816999999998,"NaN","NaN","NaN","NaN","NaN",0.2579670000000007,"NaN","NaN","NaN",1.589771000000002 lass_column_name","last_changed_column","derived_labels","classes_dict_json","hover_table_names_json"],"contact_text":"&lt;a href = \"mailto: huiyang@gwu.edu\" target=\"_blank\"&gt;Contact&lt;/a&gt;","derived":{"BP-G":{"axis":"BP-G","format":"toFixed(3)","label":"BP-G","use":true},"BP-RP":{"axis":"BP-RP","format":"toFixed(3)","label":"BP-RP","use":true},"F_x/F_o":{"axis":"F_x/F_o","format":"toExponential(3)","label":"F_x/F_o","use":true},"G-K":{"axis":"G-K","format":"toFixed(3)","label":"G-K","use":true},"H-K":{"axis":"H-K","format":"toFixed(3)","label":"H-K","use":true},"HR_h(ms)":{"axis":"HR_h(ms)","format":"toFixed(3)","label":"HR_h(ms)","use":true},"HR_hm":{"axis":"HR_hm","format":"toFixed(3)","label":"HR_hm","use":true},"HR_ms":{"axis":"HR_ms","format":"toFixed(3)","label":"HR_ms","use":true},"J-H":{"axis":"J-H","format":"toFixed(3)","label":"J-H","use":true},"M_G":{"axis":"M_G","format":"toFixed(3)","label":"M_G","use":true},"W1-W2":{"axis":"W1-W2","format":"toFixed(3)","label":"W1-W2","use":true}},"derived_func_js":"\n\n    var color_features = ['BP-G', 'BP-RP', 'G-K', 'J-H', 'H-K', 'W1-W2']\n\n    for (var f of color_features) {\n    \n        var s = f.split('-')\n        \n        //console.log('s: ', s)\n        \n        //console.log('df_custom: ', df_custom)\n        \n        //console.log('df_custom[s[0]]: ', df_custom[s[0]])\n        \n        df_custom[f] = df_custom[s[0]].map(function (v, i) { return v - df_custom[s[1]][i]; })\n    \n    }\n        \n    function hr(a, b) {\n    \n        let c = a + b\n        \n        if (c==0) return NaN    \n    \n        return (a - b) / c;\n    };\n    \n    df_custom['HR_ms'] = df_custom['F_m'].map(function (v, i) { return hr(v, df_custom['F_s'][i]); })\n    df_custom['HR_hm'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i]); })\n    df_custom['HR_h(ms)'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i] + df_custom['F_s'][i]); })\n    \n    df_custom['F_x/F_o'] = df_custom['F_b'].map(function (v, i) { \n        return Math.pow(10, Math.log10(v) + 5 - Math.log10(1.65) + df_custom['G'][i] / 2.5); })\n            \n    //df_custom[class_column] = df_custom[class_column].map(x =&gt; x.replace('ATNF', 'NS'))\n    \n    //df_custom['P_inter'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    //df_custom['P_intra'] = df_custom['P_intra'].map(x =&gt; 1.001 - x)\n    \n    if ('rgeo' in df_custom) \n    \n        df_custom['M_G'] = df_custom['rgeo'].map(function (v, i) { \n            return df_custom['G'][i] - 5 * Math.log10(v/10); })\n        \n    //df_custom['P_intra'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    \n","derived_func_py":"\n\nimport numpy as np\n\ndef hr(a, b): \n    s = a + b        \n    s[s==0] = np.nan        \n    return (a - b) / s\n\ndef derived_func(df, q):\n\n    derived_labels = [q['derived'][k]['label'] for k in q['derived'].keys()]\n\n    if 'M_G' in derived_labels:\n        df['M_G'] = df['G'] - 2.5 * np.log10((df['rgeo']/10)**2)\n\n    fh, fm, fs = df[['F_h', 'F_m', 'F_s']].to_numpy().T\n    df['HR_ms'] = hr(fm, fs) \n    df['HR_hm'] = hr(fh, fm) \n    df['HR_h(ms)'] = hr(fh, fm + fs)\n\n    color_features = ['BP-G', 'BP-RP', 'G-K', 'J-H', 'H-K', 'W1-W2']\n    for k in color_features:    \n        p1, p2 = k.split('-')    \n        df[k] = df[p1] - df[p2]\n\n    df['F_x/F_o'] = np.float_power(10, np.log10(df['F_b']) + 5 - np.log10(1.65) + df['G'] / 2.5) \n\n    # df['P_inter'] = 1.001 - df['P_inter']\n    # df['P_intra'] = 1.001 - df['P_intra']\n\n    return df\n    \n","derived_labels":["HR_ms","HR_hm","HR_h(ms)","F_x/F_o","BP-G","BP-RP","G-K","J-H","H-K","W1-W2","M_G"],"description_text":"&lt;a href=\"./RNAAS_note_about_TD.pdf\" target=\"_blank\"&gt;description&lt;/a&gt;","features":["F_b","F_h","F_m","F_s","P_inter","P_intra","Signif.","G","BP","RP","J","H","K","W1","W2","W3","rgeo","HR_ms","HR_hm","HR_h(ms)","F_x/F_o","BP-G","BP-RP","G-K","J-H","H-K","W1-W2","M_G"],"features_no_loglin":["G","BP","RP","J","H","K","W1","W2","W3","BP-G","BP-RP","G-K","J-H","H-K","W1-W2"],"flipped_axis":["M_G"],"format_js":" \n\n    function format(d) {\n            \n        var i = Number(d.DT_RowId.slice(2))\n        \n        var name = table_source.data['name'][i]\n        \n        var div_id = `\"aladin-lite-div` + name.replace(/[^A-Z0-9]+/ig, \"_\") + `\"`\n                \n        var out = '&lt;div id=' + div_id + ' style=\"width:400px;height:400px;\"&gt;&lt;/div&gt;'+\n            '&lt;script type=\"text/javascript\"&gt;' +\n            'var aladin = A.aladin(\"#' + div_id.slice(1) + ', {survey: \"P/2MASS/color\", fov:0.05, cooFrame:\"ICRSd\", target: \"' + \n            table_source.data['ra'][i] + ', ' + table_source.data['dec'][i] + '\"});&lt;/script&gt;' \n        \n        var esa_sky = 'https://sky.esa.int/?target=' + table_source.data['ra'][i] + '%20' + table_source.data['dec'][i] + \n            '&amp;hips=DSS2+color&amp;fov=0.05&amp;cooframe=J2000d&amp;sci=false&amp;lang=en&amp;hide_welcome=true&amp;hide_banner_info=true'\n            \n        var out2 = '&lt;iframe alt=\"\" border=\"0\" bordercolor=\"#000000\" frameborder=\"0\" height=\"\" hspace=\"0\" ' +\n            'scrolling=\"auto\" ' +\n            'src=\"' + esa_sky + '\" title=\"\" vspace=\"0\" width=\"400px\" ' +\n            'class=\"\" style=\"height: 400px;\"&gt;' +\n            'https://sky.esa.int?hide_welcome=true&amp;amp;&amp;amp;hide_banner_info=true.' +\n            '&lt;/iframe&gt;'   \n                \n        return out + out2\n    }\n","get_ref_link_js":"\n\n    function get_ref_link(ref) {\n    \n        var ref_link\n\n        if (ref=='INTEGRAL General Reference Catalog') {\n            ref_link = 'https://www.isdc.unige.ch/integral/science/catalogue'\n            ref = 'INTEGRAL'\n        }    \n        else if (ref=='Simbad')\n            ref_link = 'http://simbad.u-strasbg.fr/simbad/'\n        else if (ref=='LAMOST-DR8-AFGK' || ref=='LAMOST-DR8-M')\n            ref_link = 'http://www.lamost.org/dr8/'\n        else\n            ref_link = 'https://ui.adsabs.harvard.edu/abs/' + ref + '/abstract' \n\n        ref_link = '&lt;a href=\"' + ref_link + '\" target=\"_blank\"&gt;' + ref + '&lt;/a&gt;'    \n\n        return [ref, ref_link]\n    \n    }\n","help_text":"\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\nFor plotting custom objects, the user should provide a csv file.\nThe following column labels are accepted (columns with other names are ignored):\n\n    name \n    ra \n    dec \n    Class \n    ref \n\n    F_b \n    F_h \n    F_m \n    F_s \n\n    P_inter \n    P_intra \n\n    significance | Signif.\n\n    G \n    BP \n    RP \n    J \n    H \n    K \n    W1 \n    W2 \n    W3 \n \nAll columns are optional. \n\nWarning: All multiwavelength features from optical to IR bands are removed for NS in the visualization since the counterparts are matched from chance coincidence. We still keep those counterparts in the machine learning pipeline to avoid adding a bias.\n\nThe following features are calculated from the user-supplied data:\n\n    HR_ms\n    HR_hm \n    HR_h(ms)\n    F_x/F_o\n    BP-G\n    BP-RP\n    G-K\n    J-H\n    H-K\n    W1-W2\n\nHR_ms = (F_m - F_s) / (F_m + F_s)\nHR_hm = (F_h - F_m) / (F_h + F_m)\nHR_h(ms) = (F_h - F_m - F_s) / (F_h + F_m + F_s)\nF_x/F_o = F_b / (1.65e-5 * 10**(-G / 2.5))\n\nClass labels:\n\n    AGN \n    CV \n    HM-STAR \n    HMXB \n    LM-STAR \n    LMXB \n    NS  \n    YSO\n\nUnclassified objects or objects with different class labels are shown as white circles.\n\nWarning: AGN shown here come from above the Galactic plane and will look different through the plane due to much higher absorption.\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\n","hide_csv_etc_button":false,"hide_settings_panel":true,"hide_upload_button":false,"hover_table_names":{"F_b":"F_b","G":"G","HR_h(ms)":"HR_h(ms)","J":"J","W1":"W1","dec":"Decl.","name":"name","ra":"RA","ref":"ref"},"hover_table_names_json = !0, l;\n            for (l of text) {\n                if ('\"' === l) {\n                    if (s &amp;&amp; l === p) row[i] += l;\n                    s = !s;\n                } \n                else if (',' === l &amp;&amp; s) \n                    l = row[++i] = '';\n                else if ('\\n' === l &amp;&amp; s) {\n                    if ('\\r' === p) row[i] = row[i].slice(0, -1);\n                    row = ret[++r] = [l = '']; \n                    i = 0;\n                } \n                else row[i] += l;\n                p = l;\n            }\n            return ret;\n        }\n        \n        let obj = csvToArray(atob(this.value).trim())\n\n        let len = obj.length - 1\n\n        //transpose\n        obj = obj[0].map((col, i) =&gt; obj.map(([...row]) =&gt; row[i]))\n\n        let df_custom = {}\n        \n        // !!!\n        \n        for (var ob of obj) {\n        \n            let name = ob[0]\n        \n            if (!(name in all_dict)) {\n            \n                if (name in q['all']) \n                        \n                    name = q['all'][name]['label'] \n                                      \n                else continue\n                                        \n            } \n\n            let sl = ob.slice(1)\n            \n            if (name in all_dict)             \n                if (all_dict[name]['format'].match(/to/) != null)\n                    sl = sl.map(parseFloat)\n\n            df_custom[name] = sl    \n        }\n        \n            \n        function replace_from_dict(arr, dic) {\n\n            var out = [];\n            \n            for (var i=0; i&lt;arr.length; i++) {\n            \n                 var cl = arr[i];\n                 \n                 if (cl in dic)                \n                     out.push(dic[cl])\n                 else    \n                     out.push(cl)\n                       \n            }\n            \n            return out\n            \n         }   \n         \n         df_custom[q['class_column']] = replace_from_dict(df_custom[q['class_column']], q['classes_dict']) \n \n\n        \n\n    var color_features = ['BP-G', 'BP-RP', 'G-K', 'J-H', 'H-K', 'W1-W2']\n\n    for (var f of color_features) {\n    \n        var s = f.split('-')\n        \n        //console.log('s: ', s)\n        \n        //console.log('df_custom: ', df_custom)\n        \n        //console.log('df_custom[s[0]]: ', df_custom[s[0]])\n        \n        df_custom[f] = df_custom[s[0]].map(function (v, i) { return v - df_custom[s[1]][i]; })\n    \n    }\n        \n    function hr(a, b) {\n    \n        let c = a + b\n        \n        if (c==0) return NaN    \n    \n        return (a - b) / c;\n    };\n    \n    df_custom['HR_ms'] = df_custom['F_m'].map(function (v, i) { return hr(v, df_custom['F_s'][i]); })\n    df_custom['HR_hm'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i]); })\n    df_custom['HR_h(ms)'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i] + df_custom['F_s'][i]); })\n    \n    df_custom['F_x/F_o'] = df_custom['F_b'].map(function (v, i) { \n        return Math.pow(10, Math.log10(v) + 5 - Math.log10(1.65) + df_custom['G'][i] / 2.5); })\n            \n    //df_custom[class_column] = df_custom[class_column].map(x =&gt; x.replace('ATNF', 'NS'))\n    \n    //df_custom['P_inter'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    //df_custom['P_intra'] = df_custom['P_intra'].map(x =&gt; 1.001 - x)\n    \n    if ('rgeo' in df_custom) \n    \n        df_custom['M_G'] = df_custom['rgeo'].map(function (v, i) { \n            return df_custom['G'][i] - 5 * Math.log10(v/10); })\n        \n    //df_custom['P_intra'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    \n\n\n        var feat_x = features[sel_x.active]\n        var feat_y = features[sel_y.active]\n\n        if (log_source.data[feat_x][0] == 1) {\n        \n            if (['P_intra', 'P_inter'].includes(feat_x))         \n                df_custom['x'] = df_custom[feat_x].map(x =&gt; Math.log10(1/(1.001 - x)))   \n            else\n                df_custom['x'] = df_custom[feat_x].map(x =&gt; Math.log10(x)) \n            \n        } else { \n            if (['P_intra', 'P_inter'].includes(feat_x))         \n                df_custom['x'] = df_custom[feat_x].map(x =&gt; 1/(1.001 - x))   \n            else\n                df_custom['x'] = df_custom[feat_x]\n        }         \n \n        if (log_source.data[feat_y][0] == 1) {\n        \n            if (['P_intra', 'P_inter'].includes(feat_y))         \n                df_custom['y'] = df_custom[feat_y].map(x =&gt; Math.log10(1/(1.001 - x)))   \n            else\n                df_custom['y'] = df_custom[feat_y].map(x =&gt; Math.log10(x)) \n            \n        } else { \n            if (['P_intra', 'P_inter'].includes(feat_y))         \n                df_custom['y'] = df_custom[feat_y].map(x =&gt; 1/(1.001 - x))   \n            else\n                df_custom['y'] = df_custom[feat_y]\n        }         \n        \n        df_custom['color'] = []\n\n        for (var x of df_custom[class_column]) {\n\n            if (colors_dict[x])\n                df_custom['color'].push(colors_dict[x])\n            else    \n                df_custom['color'].push('black')\n         }       \n\n        df_custom['line_color'] = Array(len).fill('black')\n        df_custom['size'] = Array(len).fill(15)\n\n        var r = {}\n\n        for (const [k, v] of Object.entries(df_custom)) { \n\n            var b = df_custom[k]\n\n            var c = new Array()            \n            for (var i of b)\n                c.push(i)   \n\n            r[k] = c\n\n        }  \n\n        sources['custom'].data = r    \n\n        sources['custom'].change.emit() \n\n        //obj = Object.entries(obj)    \n        //let obj_dict = Object.assign({}, ...obj.map((x) =&gt; ({[x[0]]: x[1:]}))) \n        //const obj2 = Object.fromEntries(obj[:,0].map((key, index)=&gt; [key, ce(-8)=='selected' &amp;&amp; m!='selection') \n            //return\n\n        var cols = []\n\n        var tmp = []    \n        for (var i of sel_table_columns_1.active)\n            tmp.push(i)     \n        tmp.sort((a,b) =&gt; a-b)    \n        for (var i of tmp)    \n            cols.push(table_row1_labels[i])\n\n        tmp = []\n        for (var i of sel_table_columns_2.active)\n            tmp.push(i)        \n        tmp.sort((a,b) =&gt; a-b)         \n        for (var i of tmp)    \n            cols.push(table_row2_labels[i])\n\n        var z = {}    \n\n        for (var k of cols)   \n            z[k] = table_source.data[k]\n\n        const bottom_table = document.getElementById(\"bottom_table\")\n\n        if (cols.length==0) {\n            bottom_table.innerHTML = ''\n            return    \n        }\n\n        var n = z[cols[0]].length\n\n        \n\n    function get_ref_link(ref) {\n    \n        var ref_link\n\n        if (ref=='INTEGRAL General Reference Catalog') {\n            ref_link = 'https://www.isdc.unige.ch/integral/science/catalogue'\n            ref = 'INTEGRAL'\n        }    \n        else if (ref=='Simbad')\n            ref_link = 'http://simbad.u-strasbg.fr/simbad/'\n        else if (ref=='LAMOST-DR8-AFGK' || ref=='LAMOST-DR8-M')\n            ref_link = 'http://www.lamost.org/dr8/'\n        else\n            ref_link = 'https://ui.adsabs.harvard.edu/abs/' + ref + '/abstract' \n\n        ref_link = '&lt;a href=\"' + ref_link + '\" target=\"_blank\"&gt;' + ref + '&lt;/a&gt;'    \n\n        return [ref, ref_link]\n    \n    }\n\n\n        //var table_html = '&lt;table id=\"my_datatable\" class=\"display\" style=\"width:100%;background-color:rgba(66, 165, 245, 0.2);\"&gt;&lt;thead&gt;&lt;tr&gt;&lt;style&gt;    td.details-control {        background: url(details_open.png) no-repeat center center;        cursor: pointer;    }    tr.shown td.details-control {        background: url(details_close.png) no-repeat center center;    }    table#my_datatable.dataTable tbody:hover {      background-color: rgba(66, 165, 245, 0.2);    }    &lt;/style&gt;'\n\n        //var table_html = '&lt;table id=\"my_datatable\" class=\"table table-striped\" style=\"width:100%;\"&gt;&lt;thead&gt;&lt;tr&gt;'\n\n        var table_html = '&lt;table id=\"my_datatable\" class=\"display\" style=\"width:100%;\"&gt;&lt;thead&gt;&lt;tr&gt;'\n\n        table_html += '&lt;th&gt;&lt;/th&gt;'\n\n        for (var k of cols) \n            table_html += '&lt;th&gt;'+col2lab[k]+'&lt;/th&gt;'\n\n        table_html += '&lt;/tr&gt;&lt;/thead&gt;&lt;tbody&gt;'\n\n        for (var i=0; i&lt;n; i++) {\n\n            table_html += '&lt;tr id=\"id' + i + '\"&gt;' \n\n            table_html += '&lt;td&gt;&lt;/td&gt;' \n\n            for (var k of cols) {\n\n                var f = all_dict[k]['format']\n                \n                if (['ref'].includes(k)) {\n                                        \n                    var v = Boolean(z[k][i]) ? get_ref_link(z[k][i])[1] : '&lt;a href=\"\" target=\"_blank\"&gt;&lt;/a&gt;'    \n                    \n                    table_html += '&lt;td&gt;' + v + '&lt;/td&gt;'                     \n                    \n                }\n\n                else if (typeof z[k][i]==='number' &amp;&amp; f.match(/to/) != null) {\n\n                    const regex = /\\d+/\n                    const dig = Number(f.match(regex)[0])\n\n                    if (f.match(/toE/) != null)            \n                        table_html += '&lt;td&gt;'+ z[k][i].toExponential(dig) + '&lt;/td&gt;'\n                    else  \n                        table_html += '&lt;td&gt;'+ z[k][i].toFixed(dig) + '&lt;/td&gt;'\n                }    \n\n                else if (typeof z[k][i]==='number' &amp;&amp; !isNaN(z[k][i]))                     \n                        table_html += '&lt;td&gt;'+z[k][i].toFixed(3)+'&lt;/td&gt;' \n\n                else table_html += '&lt;td&gt;'+z[k][i]+'&lt;/td&gt;'        \n            }\n\n            table_html += '&lt;/tr&gt;'    \n        }\n\n        table_html += '&lt;/tbody&gt;&lt;/table&gt;'\n\n        bottom_table.innerHTML = table_html\n\n         \n\n    function format(d) {\n            \n        var i = Number(d.DT_RowId.slice(2))\n        \n        var name = table_source.data['name'][i]\n        \n        var div_id = `\"aladin-lite-div` + name.replace(/[^A-Z0-9]+/ig, \"_\") + `\"`\n                \n        var out = '&lt;div id=' + div_id + ' style=\"width:400px;height:400px;\"&gt;&lt;/div&gt;'+\n            '&lt;script type=\"text/javascript\"&gt;' +\n            'var aladin = A.aladin(\"#' + div_id.slice(1) + ', {survey: \"P/2MASS/color\", fov:0.05, cooFrame:\"ICRSd\", target: \"' + \n            table_source.data['ra'][i] + ', ' + table_source.data['dec'][i] + '\"});&lt;/script&gt;' \n        \n        var esa_sky = 'https://sky.esa.int/?target=' + table_source.data['ra'][i] + '%20' + table_source.data['dec'][i] + \n            '&amp;hips=DSS2+color&amp;fov=0.05&amp;cooframe=J2000d&amp;sci=false&amp;lang=en&amp;hide_welcome=true&amp;hide_banner_info=true'\n            \n        var out2 = '&lt;iframe alt=\"\" border=\"0\" bordercolor=\"#000000\" frameborder=\"0\" height=\"\" hspace=\"0\" ' +\n            'scrolling=\"auto\" ' +\n            'src=\"' + esa_sky + '\" title=\"\" vspace=\"0\" width=\"400px\" ' +\n            'class=\"\" style=\"height: 400px;\"&gt;' +\n            'https://sky.esa.int?hide_welcome=true&amp;amp;&amp;amp;hide_banner_info=true.' +\n            '&lt;/iframe&gt;'   \n                \n        return out + out2\n    }\n\n\n        var table = $('#my_datatable').DataTable({\n\n            //dom: 'lBfrtip',\n\n            //dom: 'lB',\n\n            dom: \"&lt;'row'&lt;'col-sm-4'l&gt;&lt;'col-sm-4'B&gt;&lt;'col-sm-4'f&gt;&gt;\" +\n              \"&lt;'row'&lt;'col-sm-12'tr&gt;&gt;\" +\n              \"&lt;'row'&lt;'col-sm-5'i&gt;&lt;'col-sm-7'p&gt;&gt;\",\n\n            //dom: \"&lt;'row'&lt;'col-sm-4'l&gt;&lt;'col-sm-4'B&gt;&lt;frtip&gt;&gt;\", \n\n            //buttons: ['copy', 'csv', 'excel', 'pdf'], //, 'print'],\n\n            buttons: hide_csv_etc_button ? [] : ['copy', 'csv', 'excel', 'pdf'],\n\n            columnDefs: [{  className: \"details-control\", \n                            bSortable: false,        \n                            targets: [0] \n                            }],\n\n            order: [[1, 'asc']]\n\n        })\n\n        //$('#my_datatable').on('click', 'tbody tr', function () {\n        $('#my_datatable').on('click', 'tbody td.details-control', function () {\n\n            var tr = $(this).closest('tr')\n\n            //var tr = $(this)\n\n            var row = table.row(this)\n\n            if (row.data()==null)\n                return\n\n            if ( row.child.isShown() ) {\n                // This row is already open - close it\n                row.child.hide();\n                tr.removeClass('shown')            \n            }\n            else {\n                // Open this row\n                row.child(format(row.data())).show()                    \n                tr.addClass('shown')\n\n            }\n        } );\n\n        //$('head').append('&lt;style&gt;table#my_datatable.dataTable tbody tr:nth-child(odd) {background: #f5f5f5;}&lt;/style&gt;')\n        //$('head').append('&lt;style&gt;table#my_datatable.dataTable tbody tr:hover {background-color: rgba(66, 165, 245, 0.2);}&lt;/style&gt;')    \n        //$('head').append('&lt;style&gt;table#my_datatable.dataTable tbody tr:hover &gt; .sorting_1 {background-color: rgba(66, 165, 245, 0.2);}&lt;/style&gt;')\n\n    "},"id":"4165","type":"CustomJS"},{"attributes":{"args":{"all_button":{"id":"4146"},"bottom_table_div":{"id":"4155"},"catalog_source":{"id":"4153"},"classes":["AGN","CV","HM-STAR","HMXB","LM-STAR","LMXB","NS","YSO"],"default_button":{"id":"4150"},"filtrex_button":{"id":"4158"},"filtrex_help":{"id":"4159"},"filtrex_input":{"id":"4157"},"none_button":{"id":"4148"},"sel_tabl
